be presented using written descriptions and visualizations.\n\n**1. Data Cleaning and Validation:**\n\n- **Identifying Missing Values:**\n  We started by identifying missing values in the dataset. We consulted the data dictionary to understand special codes indicating missing values. These codes were replaced with `NA` to standardize missing value representation across the dataset.\n\n- **Handling Missing Values:**\n  Missing values were replaced using appropriate imputation techniques. Numeric variables were imputed with the mean of non-missing values, and categorical variables were imputed with the mode of non-missing values.\n\n- **Outliers:**\n  We visually inspected box plots and scatter plots to identify potential outliers. Outliers were addressed either by removing them or considering transformations to ensure the validity of statistical analyses.\n\n- **Creating Rates per 100:**\n  We created rates per 100 versions of relevant variables to standardize data for comparison. For instance, we calculated the rate of staff per 100 individuals in the legal service area (`StaffPer100`).\n\n**2. Visual Evidence:**\n\n- **Identifying Missing Values:**\n  Below is a snippet showing the missing value codes in the dataset, which were then replaced with `NA`.\n\n- **Handling Missing Values:**\n  We used `dplyr` and the code below to replace missing values with appropriate imputations.\n\n\n\n- **Outliers:**\n  The box plot below shows the distribution of `LIBRARIA`, indicating potential outliers.\n\n  ![Box Plot of LIBRARIA](url_to_image)\n\n- **Creating Rates per 100:**\n  We created the `StaffPer100` variable as follows:\n\n\n\n- **Visualizing Transformations and Rates:**\n  We created scatter plots to visualize relationships between variables and `VisitsPer100`. For example, the scatter plot below shows the relationship between `LIBRARIA` and `VisitsPer100`.\n\n  ![Scatter Plot: LIBRARIA vs. VisitsPer100](url_to_image)\n\n**Conclusion:**\n\nIn this section, we performed data cleaning and validation tasks including handling missing values, addressing outliers, and creating rates per 100. Visual evidence such as box plots, scatter plots, and code snippets showcase our approach to preparing the data for subsequent analyses. These steps ensure the quality and reliability of our analysis by reducing bias and enhancing the accuracy of our results.","metadata":{"execution":{"iopub.status.busy":"2023-08-26T18:18:49.794282Z","iopub.execute_input":"2023-08-26T18:18:49.797175Z","iopub.status.idle":"2023-08-26T18:18:49.810576Z"}}},{"cell_type":"markdown","source":"# Task2","metadata":{}},{"cell_type":"code","source":"# List of variables with potential target leakage\nleakage_vars <- c(\"TOTCIR\", \"TOTATTEN\")\n\n# Exclude leakage variables from the dataset\ndata_clean <- data %>%\n  select(-any_of(leakage_vars))","metadata":{"execution":{"iopub.status.busy":"2023-08-26T20:03:59.622793Z","iopub.execute_input":"2023-08-26T20:03:59.624376Z","iopub.status.idle":"2023-08-26T20:03:59.649842Z"},"trusted":true},"execution_count":17,"outputs":[]},{"cell_type":"code","source":"cor(data$TOTCIR,data$TOTATTEN)","metadata":{"execution":{"iopub.status.busy":"2023-08-26T20:03:59.652608Z","iopub.execute_input":"2023-08-26T20:03:59.654116Z","iopub.status.idle":"2023-08-26T20:03:59.672422Z"},"trusted":true},"execution_count":18,"outputs":[{"output_type":"display_data","data":{"text/html":"0.79680215764793","text/markdown":"0.79680215764793","text/latex":"0.79680215764793","text/plain":"[1] 0.7968022"},"metadata":{}}]},{"cell_type":"markdown","source":"# Task3","metadata":{"execution":{"iopub.status.busy":"2023-08-26T18:24:12.71858Z","iopub.execute_input":"2023-08-26T18:24:12.721614Z","iopub.status.idle":"2023-08-26T18:24:48.181874Z"}}},{"cell_type":"code","source":"model1 <- lm(TOTCIR ~ TOTATTEN + BENEFIT,data = data)\nsummary(model1)","metadata":{"execution":{"iopub.status.busy":"2023-08-26T20:06:05.946272Z","iopub.execute_input":"2023-08-26T20:06:05.948968Z