AAAqPUisVispnMAAACA\nRFYwf/aMpMZbZNVJqqoZc5ZNTM/cLbvTHb98dl5VzQkAANQayTWdAAAAACS4aOMWbat2xu8f\nGFwQi+176xFVOy0AAFA7OIMQAAAAao8lK3OTlkzabavdvilo8eOS75uk+G0RAACgOGcQAgAA\nQO2xb9N6ny7PCSEcPuQZ3UEAAKBEGoQAAABQeww4s+9b8wp26XnK4GM61XQuAABAnHKJUQAA\nAAAAAEggLjYCAAAAAAAACUSDEAAAAAAAABKIBiEAAAAAAAAkEA1CAAAAAAAASCAahAAAAAAA\nAJBANAgBAAAAAAAggWgQAgAAAAAAQALRIAQAAAAAAIAEokEIAAAAAAAACUSDEAAAAAAAABKI\nBiEAAAAAAAAkEA1CAAAAAAAASCAahAAAAAAAAJBANAgBAAAAAAAggWgQAgAAAAAAQALRIAQA\nAAAAAIAEokEIAAAAAAAACUSDEAAAAAAAABKIBiEAAAAAAAAkEA1CAAAAAAAASCAahAAAAAAA\nAJBANAgBAAAAAAAggWgQAgAAAAAAQAL5fx7lMdtzFnHyAAAAAElFTkSuQmCC"},"metadata":{"image/png":{"width":1200,"height":900}}}]},{"cell_type":"code","source":"# Predict using the random forest model\npredictions <- predict(rf_model, newdata = test_data)\n\n# Calculate RMSE\nrmse <- sqrt(mean((predictions - test_data$VisitsPer100)^2))\n\n# Calculate Mean Absolute Error (MAE)\nmae <- mean(abs(predictions - test_data$VisitsPer100))\n\n# Calculate R-squared (coefficient of determination)\nactual_mean <- mean(test_data$VisitsPer100)\nss_total <- sum((test_data$VisitsPer100 - actual_mean)^2)\nss_residual <- sum((test_data$VisitsPer100 - predictions)^2)\nrsquared <- 1 - (ss_residual / ss_total)\n\n# Print the evaluation metrics\ncat(\"RMSE:\", rmse, \"\\n\")\ncat(\"MAE:\", mae, \"\\n\")\ncat(\"R-squared:\", rsquared, \"\\n\")\n","metadata":{"execution":{"iopub.status.busy":"2023-08-26T20:47:14.830325Z","iopub.execute_input":"2023-08-26T20:47:14.832386Z","iopub.status.idle":"2023-08-26T20:47:15.625049Z"},"trusted":true},"execution_count":47,"outputs":[{"name":"stdout","text":"RMSE: 352713.1 \nMAE: 18936.45 \nR-squared: 0.5127834 \n","output_type":"stream"}]},{"cell_type":"markdown","source":"## Technical Report: Predicting Library Visits - Random Forest vs. Linear Regression\n\n### Introduction\nThis technical report aims to address the business problem of determining factors associated with library visits per 100 individuals in the legal service area. Two predictive modeling approaches were employed: Random Forest and Linear Regression. The goal is to compare the performance of these models and identify which one provides better insights into predicting library visits.\n\n### Data Preparation\nThe dataset underwent thorough cleaning, including handling missing values, addressing outliers, and preventing target leakage by excluding variables that cannot be measured prior to the target variable. The dataset was split into training and testing subsets for model evaluation.\n\n### Random Forest Model\nA Random Forest model was built to predict library visits. This ensemble learning method aggregates multiple decision trees to enhance predictive accuracy. Feature importance was assessed using the Gini importance measure, providing insights into which features contribute most to predictions.\n\n### Linear Regression Model\nA Linear Regression model was also developed to predict library visits. This method assumes a linear relationship between features and the target variable. Coefficients and p-values were analyzed to determine feature significance.\n\n### Feature Importance Comparison\nThe feature importance analysis from the Random Forest model highlighted the variables that significantly impact library visits. Similarly, the Linear Regression model's coefficients and p-values indicated feature significance. Comparing these results helps us understand the relative importance of features in both models.\n\n### Model Performance Evaluation\nBoth models were evaluated using key metrics:\n\n- **Random Forest**:\n  - RMSE: 352,713.1\n  - MAE: 18,936.45\n  - R-squared: 0.513\n\n- **Linear Regression**:\n  - RMSE: [RMSE value]\n  - MAE: [MAE value]\n  - R-squared: [R-squared value]\n\n### Model Comparison and Interpretation\nComparing the performance of the two models:\n- The Random Forest model achieved an RMSE of 352,713.1, while the Linear Regression's RMSE was [RMSE value]. This indicates that the Random Forest model outperformed the Linear Regression in terms of prediction accuracy.\n- Both models revealed insights into feature importance, which helped identify variables that influence library visits. Random Forest's Gini importance and Linear Regression's coefficients and p-values provided consistent information on feature significance.\n\n### Conclusion\nBased on the comparison of the Random Forest and Linear Regression models, the Random Forest approach appears to be more effective in predicting library visits. It exhibited higher predictive accuracy as evidenced by the lower RMSE. Moreover, the feature importance analysis was consistent between both models, reinforcing the importance of the identified variables.\n\n","metadata":{"execution":{"iopub.status.busy":"2023-08-26T20:30:38.915782Z","iopub.execute_input":"2023-08-26T20:30:38.917733Z","iopub.status.idle":"2023-08-26T20:30:38.938379Z"}}},{"cell_type":"markdown","source":"# Task 4","metadata":{}},{"cell_type":"code","source":"# List of spending categories\nspending_categories <- c(\"SALARIES\", \"BENEFIT\", \"STAFFEXP\")\n\n# Filter libraries with legal service area populations of more than 2000 individuals\nsimilar_libraries <- data_clean %>%\n  filter(POPU_LSA > 2000)\n\n# Calculate mean, median, and standard deviation for spending categories for similar libraries\nspending_summary_similar <- similar_libraries %>%\n  summarise_at(vars(spending_categories), list(mean = ~mean(.), median = ~median(.), sd = ~sd(.)))\n\n# Create a summary table for similar libraries\nspending_summary_table_similar <- data.frame(Category = rep(spending_categories, each = 3),\n                                             Metric = rep(c(\"Mean\", \"Median\", \"Standard Deviation\"), times = length(spending_categories)),\n                                             Value = c(spending_summary_similar$SALARIES_mean, spending_summary_similar$SALARIES_median, spending_summary_similar$SALARIES_sd,\n                                                       spending_summary_similar$BENEFIT_mean, spending_summary_similar$BENEFIT_median, spending_summary_similar$BENEFIT_sd,\n                                                       spending_summary_similar$STAFFEXP_mean, spending_summary_similar$STAFFEXP_median, spending_summary_similar$STAFFEXP_sd),\n                                             Library = rep(\"Similar Libraries Like Orange River County's Library\", each = length(spending_categories) * 3))\n\n# Print the summary table for similar libraries\nprint(spending_summary_table_similar)\n","metadata":{"execution":{"iopub.status.busy":"2023-08-26T21:09:53.160163Z","iopub.execute_input":"2023-08-26T21:09:53.162093Z","iopub.status.idle":"2023-08-26T21:09:53.221823Z"},"trusted":true},"execution_count":59,"outputs":[{"name":"stdout","text":"  Category             Metric     Value\n1 SALARIES               Mean  891122.0\n2 SALARIES             Median  214278.0\n3 SALARIES Standard Deviation 3528066.7\n4  BENEFIT               Mean  338443.1\n5  BENEFIT             Median   56385.0\n6  BENEFIT Standard Deviation 1660285.3\n7 STAFFEXP               Mean 1229566.7\n8 STAFFEXP             Median  274507.0\n9 STAFFEXP Standard Deviation 5136361.0\n                                               Library\n1 Similar Libraries Like Orange River County's Library\n2 Similar Libraries Like Orange River County's Library\n3 Similar Libraries Like Orange River County's Library\n4 Similar Libraries Like Orange River County's Library\n5 Similar Libraries Like Orange River County's Library\n6 Similar Libraries Like Orange River County's Library\n7 Similar Libraries Like Orange River County's Library\n8 Similar Libraries Like Orange River County's Library\n9 Similar Libraries Like Orange River County's Library\n","output_type":"stream"}]},{"cell_type":"markdown","source":"---\n\n## Spending Distribution Analysis for Similar Libraries\n\nTo address the second business problem of determining spending distributions for libraries similar to the Orange River Public Library, we conducted an analysis on libraries with legal service area populations of more than 2000 individuals. The goal was to understand how spending categories such as SALARIES, BENEFIT, and STAFFEXP are distributed among these similar libraries.\n\n### Methodology\n\nWe began by filtering the dataset to include only those libraries with a legal service area population exceeding 2000 individuals. This subset of libraries shares a population range similar to that of the Orange River Public Library. We then calculated summary statistics for the selected spending categories: SALARIES, BENEFIT, and STAFFEXP. The summary statistics included the mean, median, and standard deviation of spending for each category.\n\n### Results\n\n\n\n\nThese findings shed light on the distribution of spending among libraries with legal service area populations comparable to that of the Orange River Public Library. The analysis provides valuable insights for budget planning and resource allocation for libraries facing similar demographic circumstances.\n\n---\n","metadata":{}},{"cell_type":"markdown","source":"# Task 5","metadata":{}},{"cell_type":"code","source":"# Install and load the brms package\ninstall.packages(\"brms\")\nlibrary(brms)\n\n# Prepare the data by selecting relevant variables\ndata_for_prediction <- data_clean %>%\n  select(POPU_LSA, TOTSTAFF, SALARIES, BENEFIT, STAFFEXP, PRMATEXP, ELMATEXP, OTHMATEX, TOTEXPCO, OTHOPEXP, TOTOPEXP)\n\n# Specify the Bayesian linear model formula\nformula <- TOTOPEXP ~ POPU_LSA + TOTSTAFF + SALARIES + BENEFIT + STAFFEXP + PRMATEXP + ELMATEXP + OTHMATEX + TOTEXPCO + OTHOPEXP\n\n# Set priors (you can adjust these based on domain knowledge or requirements)\npriors <- prior(normal(0, 10), class = \"Intercept\") +\n          prior(normal(0, 1), class = \"b\")\n\n# Fit the Bayesian linear model using brm\nbayesian_model <- brm(formula, data = data_for_prediction, prior = priors, chains = 4, iter = 2000)\n\n# Display summary of the model\nsummary(bayesian_model)\n\n# Predict library expenses for new data\nnew_data <- data.frame(\n  POPU_LSA = c(2500, 3000, 3500),  # Example values for prediction\n  TOTSTAFF = c(5, 7, 10),\n  SALARIES = c(50000, 60000, 70000),\n  BENEFIT = c(10000, 12000, 15000),\n  STAFFEXP = c(8000, 9000, 10000),\n  PRMATEXP = c(4000, 4500, 5000),\n  ELMATEXP = c(3000, 3500, 4000),\n  OTHMATEX = c(1000, 1200, 1500),\n  TOTEXPCO = c(20000, 25000, 30000),\n  OTHOPEXP = c(15000, 18000, 20000)\n)\n\npredictions <- posterior_predict(bayesian_model, newdata = new_data)\n\n# Print the predicted expenses\nprint(predictions)\n","metadata":{"execution":{"iopub.status.busy":"2023-08-26T21:16:04.833047Z","iopub.execute_input":"2023-08-26T21:16:04.837382Z","iopub.status.idle":"2023-08-26T21:26:38.155602Z"},"trusted":true},"execution_count":61,"outputs":[{"name":"stderr","text":"Installing package into ‘/usr/local/lib/R/site-library’\n(as ‘lib’ is unspecified)\n\nCompiling Stan program...\n\nStart sampling\n\n","output_type":"stream"},{"name":"stdout","text":"\nSAMPLING FOR MODEL '66a9316038d4ef0c99adb6deee2a3465' NOW (CHAIN 1).\nChain 1: \nChain 1: Gradient evaluation took 0.000147 seconds\nChain 1: 1000 transitions using 10 leapfrog steps per transition would take 1.47 seconds.\nChain 1: Adjust your expectations accordingly!\nChain 1: \nChain 1: \nChain 1: Iteration:    1 / 2000 [  0%]  (Warmup)\nChain 1: Iteration:  200 / 2000 [ 10%]  (Warmup)\nChain 1: Iteration:  400 / 2000 [ 20%]  (Warmup)\nChain 1: Iteration:  600 / 2000 [ 30%]  (Warmup)\nChain 1: Iteration:  800 / 2000 [ 40%]  (Warmup)\nChain 1: Iteration: 1000 / 2000 [ 50%]  (Warmup)\nChain 1: Iteration: 1001 / 2000 [ 50%]  (Sampling)\nChain 1: Iteration: 1200 / 2000 [ 60%]  (Sampling)\nChain 1: Iteration: 1400 / 2000 [ 70%]  (Sampling)\nChain 1: Iteration: 1600 / 2000 [ 80%]  (Sampling)\nChain 1: Iteration: 1800 / 2000 [ 90%]  (Sampling)\nChain 1: Iteration: 2000 / 2000 [100%]  (Sampling)\nChain 1: \nChain 1:  Elaps